  `name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '任务名称',
  `task_code` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '任务编号',
  `wh_c_id` int(11) NULL DEFAULT NULL COMMENT '关联容器id',
  `container_code` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL COMMENT '关联容器编号',
  `w_id` int(11) NULL DEFAULT NULL COMMENT '关联工作台id',
  `w_b_id` int(11) NULL DEFAULT NULL COMMENT '关联的工作位id',
  `from_location_code` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '起始库位',
  `to_location_code` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '目标库位',
  `type` enum('1','2','3','4','5','6','7') CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '任务类型:1=入库,2=出库,3=理货入库,4=理货出库,5=移库,6=播种墙操作,7=其他任务',
  `status` enum('1','2','3','4') CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '1' COMMENT '任务状态:1=创建,2=执行中,3=执行成功,4=执行失败',
  `content` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '任务内容',
  `is_retry_switch` tinyint(1) NOT NULL DEFAULT 0 COMMENT '是否重试',
  `retry_id` int(11) NULL DEFAULT NULL COMMENT '重试任务id',
  `aid` int(11) NOT NULL COMMENT '创建人',
  `add_time` int(11) NOT NULL COMMENT '创建时间',
  `up_time` int(11) NULL DEFAULT NULL COMMENT '更新时间',
  `cid` int(11) NOT NULL DEFAULT 1 COMMENT '渠道id',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 695 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '飞变Iot任务' ROW_FORMAT = DYNAMIC;

