  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商品名称',
  `py` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '首拼字母',
  `numbering` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商品编号',
  `spec` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '件' COMMENT '规格型号',
  `cate_id` int(11) NULL DEFAULT NULL COMMENT '商品分类',
  `brand_id` int(11) NULL DEFAULT NULL COMMENT '商品品牌',
  `measure_unit_id` int(11) NULL DEFAULT NULL COMMENT '商品计量单位id',
  `measure_unit` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商品计量单位',
  `weight_unit_id` int(11) NULL DEFAULT NULL COMMENT '商品重量单位id',
  `weight_unit` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商品重量单位',
  `volume_unit_id` int(11) NULL DEFAULT NULL COMMENT '商品体积单位id',
  `volume_unit` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商品体积单位',
  `fw` float NULL DEFAULT 0 COMMENT '毛重',
  `nw` float NULL DEFAULT 0 COMMENT '净重',
  `volume_size` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '长*宽*高',
  `pack_unit` int(11) NULL DEFAULT NULL COMMENT '最小包装单位',
  `min_pack_qty` int(11) NULL DEFAULT NULL COMMENT '最小包装数',
  `is_warrnty_parts` enum('1','2') CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '是否质保件:1=是,2=否',
  `is_lot_out` enum('1','2') CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '是否管控模式:1=是,2=否',
  `in_stock` enum('1','2') CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '是否入库:1=是,2=否',
  `is_onepiece` enum('1','2') CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '是否单件型:1=是,2=否',
  `in_control` enum('1','2') CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '是否控制:1=是,2=否',
  `mp_type` enum('1','2') CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '购置状态:1=外购,2=自产',
  `pick_type_id` int(11) NULL DEFAULT NULL COMMENT '配送形式id',
  `pick_type` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '配送形式',
  `sale_type_id` int(11) NULL DEFAULT NULL COMMENT '销售模式id',
  `sale_type` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '销售模式',
  `bom_type_id` int(11) NULL DEFAULT NULL COMMENT 'Bom方式id',
  `bom_type` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'Bom方式',
  `serial_no` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '件号',
  `warrnty_parts` int(11) NULL DEFAULT NULL COMMENT '保质期',
  `packing_type_id` int(11) NULL DEFAULT NULL COMMENT '包装类型id',
  `packing_type` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '包装类型',
  `buy` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '购货价格',
  `sell` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '销货价格',
  `retail` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '零售价格',
  `integral` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '兑换积分',
  `code` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '条形码',
  `wh_id` int(11) NULL DEFAULT NULL COMMENT '默认仓库',
  `wh_l_id` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '商品货位',
  `stocktip` decimal(10, 2) NULL DEFAULT 0.00 COMMENT '库存阈值',
  `retail_name` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '零售名称',
  `imgs` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '商品图片',
  `details` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '商品详情',
  `info` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '备注信息',
  `more` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '扩展信息',
  `aid` int(11) NULL DEFAULT NULL COMMENT '创建人',
  `add_time` int(11) NULL DEFAULT NULL COMMENT '创建时间',
  `up_aid` int(11) NULL DEFAULT NULL COMMENT '修改人',
  `up_time` int(11) NULL DEFAULT NULL COMMENT '修改时间',
  `cid` int(11) NULL DEFAULT 1 COMMENT '渠道id',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `name_py_number_code`(`name`, `py`, `numbering`, `code`) USING BTREE,
  INDEX `brand_unit_warehouse`(`brand_id`, `measure_unit_id`, `wh_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 29 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '商品表' ROW_FORMAT = DYNAMIC;

